import React from "react";
import importFishStyle from "../../styles/ImportFish.module.scss";
const ImportFish = () => {
  return (
    <div className={importFishStyle.importFish}>
      <h2 id="hometitle" className={importFishStyle.homeTitle}>
        Cá Biển Nhập Khẩu
      </h2>
      <div id="product" className={importFishStyle.container} >
          <ul style={{background: "red"}}>
              <div>
                  <li>
                        <img src="http://www.vanthinhseafoods.com/images/Sanphamseafood/CUTTLEFISH%20-%20Muc%20nang/Whole%20Clean%20Cuttlefish.jpg"/>
                  </li>
              </div>
          </ul>
          

      </div>
    </div>
  );
};

export default ImportFish;
